import './App.css';
import React from 'react';
import { 
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Router>
        <Switch>
          <div className="App">
            Time For Work
          </div>
        </Switch>
      </Router>
    );
  }
}

export default App;
